INSERT INTO `notice` VALUES (68,'<h1>8/15(일) 13:00 ~ 8/19(목) 24:00 까지</h1><p><br></p><p>팀구성을 진행해주세요.</p><p><br></p><p>완성된 팀은 팀구 페이지의 팀풀 페이지를 통해 팀원을 등록해주세요.</p><p><br></p><h1><strong style=\"color: rgb(230, 0, 0);\">이때 반드시 팀장만 제출해주시면 됩니다.</strong></h1><p><br></p><p>(팀원은 제출하지 말아주세요.)</p><p><br></p><p>팀 구성의 기준은 <strong><u>[5인 1팀] </u></strong>이며 해당 조건은 반드시 지켜주셔야 합니다.</p><p><br></p><p>다들 남은 프로젝트 기간 충실히 수행하여 좋은 결과물을 만들어내기를 기원합니다.</p>','2021-08-20 03:00:56.000000','2021-08-20 03:00:56.000000','공통프로젝트 팀구성을 진행해주세요',1),(69,'<p><img src=\"https://i5a202.p.ssafy.io:8080/api/file/display?url=notice/images/04b29480233f4def5c875875b6bdc3b1.png/\"></p><p><br></p><p>다들 8월 한 달 무탈하셨죠!</p><p><br></p><p>벌써 8월도 10일 밖에 남지 않은 시점입니다.</p><p><br></p><p>설문 조사를 위해 교육생 여러분들의 서명이 필요합니다.</p><p><br></p><h2>반드시<span style=\"color: rgb(230, 0, 0);\"> 8/25(수) 19:00</span> 까지 서명 파일을 작성하여 제출해주시기를 바랍니다.</h2>','2021-08-20 03:06:06.000000','2021-08-20 03:06:06.000000','8월 교육에 대한 설문을 진행합니다.',1),(70,'<h1><strong><u>최근 유튜브 강의 출석률이 굉장히 미흡한 상태입니다.</u></strong></h1><p><br></p><p>다들 프로젝트 기간이라 육체적으로나 마음적으로 힘들다는 것을 이해하지만 <strong style=\"color: rgb(230, 0, 0);\">꼭 유튜브 라이브에 참석해주셔야 합니다.</strong></p><p><br></p><p>유튜브 출석을 항상 확인하고 있으며 이를 반영할 계획에 있습니다.</p><p><br></p><p>양질의 유튜브 강의와 프로젝트, 2마리 토끼를 다 잡는 교육생이 되시기를 바랍니다.</p><p><br></p><p><br></p>','2021-08-20 03:10:30.000000','2021-08-20 03:10:30.000000','유튜브 강의 참여도가 미흡합니다.',1),(71,'<h1>08/22(일) ~ 08/28(토) 까지 팀구레이스를 진행합니다.</h1><p><br></p><p><img src=\"https://i5a202.p.ssafy.io:8080/api/file/display?url=notice/images/7e064e98a822505ba0cc84e3cddec86d.jpg/\"></p><p><br></p><h1><strong style=\"background-color: rgb(255, 255, 204);\">1등에게는 무려 일론 머스크와의 통화가 준비되어 있습니다.</strong></h1><p><br></p><p>저도 굉장히 탐나는 상품인데요. </p><p><br></p><p>다들 한 주간 팀구레이스에 몰입하여 좋은 기회를 얻어가면 어떨까 싶습니다.</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>','2021-08-20 03:15:05.000000','2021-08-20 03:15:05.000000','팀~구~레~이~스',1),(72,'<h1 class=\"ql-align-center\"><strong>이 달의 베스트 교육생을 발표합니다</strong></h1><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\">두구두구두구두구두구두구두구.........................</p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><h2 class=\"ql-align-center\">🎉🎉축하합니다🎉🎉</h2><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><h2 class=\"ql-align-center\"><strong style=\"background-color: rgb(255, 235, 204);\">2반 강승현</strong></h2><h2 class=\"ql-align-center\"><br></h2><h2 class=\"ql-align-center\"><strong style=\"background-color: rgb(255, 255, 0);\">2반 안석현</strong></h2><h2 class=\"ql-align-center\"><br></h2><h2 class=\"ql-align-center\"><strong style=\"background-color: rgb(235, 214, 255);\">2반 이동길</strong></h2><h2 class=\"ql-align-center\"><br></h2><h2 class=\"ql-align-center\"><strong style=\"background-color: rgb(255, 235, 204);\">2반 이용재</strong></h2><h2 class=\"ql-align-center\"><br></h2><h2 class=\"ql-align-center\"><strong style=\"background-color: rgb(255, 255, 0);\">2반 장동균</strong></h2><h2 class=\"ql-align-center\"><br></h2><h2 class=\"ql-align-center\"><strong style=\"background-color: rgb(0, 138, 0);\">2반 장민호</strong></h2><h2 class=\"ql-align-center\"><br></h2><h2 class=\"ql-align-center\"><strong style=\"background-color: rgb(178, 178, 0);\">2반 현선미</strong></h2><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><h2 class=\"ql-align-center\">이 달의 베스트 교육생들에게는 50만원 상당의 아웃백 쿠폰이 지급됩니다.</h2><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\">다른 교육생 여러분들도 다음 달의 베스트 교육생이 되기 위해 노력해보아요.</p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p>','2021-08-20 03:23:51.000000','2021-08-20 03:23:51.000000','이 달의 베스트 교육생을 발표합니다.',1),(73,'<h1><strong>😍😍오매불망하던 팀구 밋업이 드디어 돌아왔습니다.😍😍</strong></h1><p><br></p><p>이번 팀구 밋업은 다채로운 교육 컨텐츠 뿐만 아니라 초대 가수의 공연까지 준비되어있다고 하는데요.</p><p><br></p><p>바로......</p><p><br></p><p><img src=\"https://i5a202.p.ssafy.io:8080/api/file/display?url=notice/images/8afa220ae420aaeb72e8304dcb1d93f5.jpg/\"></p><p><br></p><h2><strong style=\"background-color: rgb(0, 0, 0); color: rgb(255, 255, 255);\">블랙</strong><strong style=\"background-color: rgb(250, 204, 204);\">핑크</strong><strong> 입니다!</strong></h2><p><br></p><p>어렵게 모신 초대가수이니 많은 호응과 채팅 부탁드리겠습니다.</p><p><br></p><p><br></p><p><br></p>','2021-08-20 03:30:12.000000','2021-08-20 03:30:12.000000','8월 31일 드디어 팀구 밋업이 준비되어있습니다.',1),(74,'<h1><strong>드디어!</strong></h1><p><br></p><h2><strong>9월 부터 한 달간 교육생 여러분들이 지금까지 갈고 닦아온 알고리즘 실력을 경연하는 대회가 준비되었습니다.</strong></h2><p><br></p><h2><strong style=\"background-color: rgb(230, 0, 0); color: rgb(255, 255, 255);\">이름하야~ 일~타~쌍~피~</strong></h2><p><br></p><p><img src=\"https://i5a202.p.ssafy.io:8080/api/file/display?url=notice/images/c9cb6b400a1e185d3f5b0edbad6d024b.png/\"></p><p><br></p><h2>여러분들에게는 총 48개의 패가 주어집니다.</h2><h2><br></h2><h2>여기에서 가장 빠르게 🥇🥇삼팔광땡을 뽑는 교육생이 승리하게 됩니다.</h2><p><br></p><p>48개의 패 중 단 2개의 패를 빠르게 뽑는 일타쌍피.... 벌써 부터 알고리즘적인 아이디어들이 샘솟지 않나요?</p><p><br></p><p>여러분들의 참신하고 획기적인 아이디어를 기다리겠습니다.</p>','2021-08-20 03:46:27.000000','2021-08-20 03:46:27.000000','알고리즘 경연 대회 일 타 쌍 피',1);
